import React from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataCard = ({ data }) => {
	// break up data
	const nyt = data.data[0];
	const gaurdian = data.data[1];

	const process = arr => {
		return typeof arr == 'undefined'
			? null
			: arr.map(item => {
					return item;
			  });
	};
	const nytData = process(nyt);
	const gaurdianData = process(gaurdian);

	const combineData = (arr1, arr2) => {
		return nytData !== null ? arr1.concat(arr2) : null;
	};

	const allData = combineData(nytData, gaurdianData);
	console.log(allData);

	if (allData !== null) {
		allData.map(item => {
			return <h1>data</h1>;
		});
	}

	return <h1>data</h1>;
};

// if (typeof gaurdian !== 'undefined') {
// 	gaurdian.map(item => {
// 		console.log(item);
// 	});
// }

DataCard.propTypes = {
	DataCard: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps)(DataCard);
